import { View, Text, StyleSheet, ImageBackground, Image } from 'react-native'
import React from 'react'
import HeaderBgImage from "../images/loginBg.jpg";
import shopLogo from "../images/icon-02.png";
import bdLogo from "../images/icon-01.png";
import cardLogo from "../images/icon-03.png";

export default function Quotation() {
  return (
    <View style={styles.container}>
    <View style={styles.quotationTopCotainer}>
       <ImageBackground source={HeaderBgImage} resizeMode="cover" style={{flex:1}}>
           <View style={styles.titleContainer}>
               <Text style={styles.hireTitle}>THE LARGEST</Text>
               <Text style={styles.hireTitle}>EQUIPMENT RENTAL NETWORK</Text>
           </View>
       </ImageBackground>
    </View>
    <View style={styles.quotationArea}>
      
    </View>
    <View style={styles.hireBottomArea}>
           <View>
              <Image style={styles.bottomLogo} source={shopLogo} />    
           </View>
           <View style={styles.middleLogo}>
              <Image style={styles.bottomLogo} source={bdLogo} />    
           </View>
           <View>
              <Image style={styles.bottomLogo} source={cardLogo} />    
           </View>
    </View>
</View>
  )
}

const styles = StyleSheet.create({
    container:{
     flex:1,
    //   backgroundColor:"#f6921e"
    },
    quotationTopCotainer:{
      flex:0.5,
      borderBottomRightRadius:40,
      borderBottomLeftRadius:40,
      overflow:"hidden"
    },
    hireMiddleCotainer:{
      flex:1,
      alignItems:"center",
      marginTop:30,
      gap:25
    },
    titleContainer:{
        flex:1,
        justifyContent:"center",
        alignItems:"center"
    },
    hireTitle:{
        fontSize:15,
        textAlign:"center",
        color:"#fff",
        // paddingTop:10,
        // paddingBottom:10
        
    },
    bottomLogo:{
        width: 50,
        height: 50,
    },
    hireBottomArea:{
        flex: 0.1,
        flexDirection:"row",
        alignItems:"flex-end",
        justifyContent:"space-around",
        backgroundColor:"#fff",
        paddingTop:10
    },
    middleLogo:{
        backgroundColor:"#dfe6e9",
        padding:10,
        borderRadius:50
    }

    

    
})
